import React from 'react';
import {createField} from "../../common/FormsControls/FormsControls";

const ProfileDataForm = () => {
    return <form>
        <div><button onClick={goToEditMode}>edit</button></div>
        <div>
            <b>Full name</b>: {createField(placeholder, name, component, validate, props = {}, text = '')}
        </div>
        <div>
            <b>Locking for a job</b>: {profile.lookingForAJob ? 'yes' : 'no'}
        </div>
        {profile.lookingForAJob &&
        <div>
            <b>My professional skills</b>: {profile.lookingForAJobDescription}
        </div>
        }
        <div>
            <b>About me</b>: {profile.aboutMe ? 'yes' : 'no'}
        </div>
    </form>
};

export default ProfileDataForm;
